script: |
  super -f text -I q5368.spq | sort > q5368.out

inputs:
  - name: q5368.spq
    data: |
      SELECT + ( + ( col0 ) ) / - CAST ( - col2 AS INTEGER ) AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( col2 ) BETWEEN ( col2 - - col0 ) AND 75;
  - name: tab1

outputs:
  - name: q5368.out
    data: |
